/* ================= latest_blog_area css ============= */
.latest_blog_area {
    background: #f9f9ff;
}

.single-recent-blog-post {
    margin-bottom: 30px;

    .thumb {
        overflow: hidden;

        img {
            transition: all .7s linear;
        }
    }

    .details {
        padding-top: 30px;

        .sec_h4 {
            line-height: 24px;
            padding: 10px 0 13px;
            transition: all .3s linear;

            &:hover {
                // color: $pfont;
            }
        }
    }

    .date {
        font-size: 14px;
        line-height: 24px;
        font-weight: 400;
    }

    &:hover {
        img {
            transform: scale(1.23) rotate(10deg);
        }
    }
}

.tags {
    .tag_btn {
        font-size: 12px;
        font-weight: 500;
        line-height: 20px;
        border: 1px solid #eee;
        display: inline-block;
        padding: 1px 18px;
        text-align: center;

        // color: $title-color;
        &:before {
            // background: $title-color;
        }

        & + .tag_btn {
            margin-left: 2px;
        }
    }
}

/* ========= blog_categorie_area css =========== */
.blog_categorie_area {
    padding-top: 30px;
    padding-bottom: 30px;
    // background: $lightGray;

    @media (min-width: 900px) {
        padding-top: 80px;
        padding-bottom: 80px;
    }

    @media (min-width: 1100px) {
        padding-top: 120px;
        padding-bottom: 120px;
    }
}

.categories_post {
    position: relative;
    text-align: center;
    cursor: pointer;

    img {
        max-width: 100%;
    }

    .categories_details {
        position: absolute;
        top: 20px;
        left: 20px;
        right: 20px;
        bottom: 20px;
        background: rgba(34, 34, 34, .75);
        color: #fff;
        transition: all .3s linear;
        display: flex;
        align-items: center;
        justify-content: center;

        h5 {
            margin-bottom: 0;
            font-size: 18px;
            line-height: 26px;
            text-transform: uppercase;
            color: #fff;
            position: relative;
            //          &:before{
            //              content: "";
            //              height: 1px;
            //              width: 100%;
            //              background: #fff;
            //              position: absolute;
            //              bottom: 0;
            //              left: 0;
            //          }
        }

        p {
            font-weight: 300;
            font-size: 14px;
            line-height: 26px;
            margin-bottom: 0;
        }

        .border_line {
            margin: 10px 0;
            background: #fff;
            width: 100%;
            height: 1px;
        }
    }

    &:hover {
        .categories_details {
            background: rgba(222, 99, 32, .85);
        }
    }
}

/* ============ blog_left_sidebar css ============== */

.blog_item {
    margin-bottom: 50px;
}

.blog_details {
    padding: 30px 0 20px 10px;
    box-shadow: 0 10px 20px 0 rgba(221, 221, 221, .3);

    @media (min-width: 768px) {
        padding: 60px 30px 35px 35px;
    }

    p {
        margin-bottom: 30px;
    }

    a {
        color: $heading_color2;

        &:hover {
            color: $btn_bg;
        }
    }

    h2 {
        font-size: 18px;
        font-weight: 600;
        margin-bottom: 8px;

        @media (min-width: 768px) {
            font-size: 24px;
            margin-bottom: 15px;
        }
    }
}

.blog-info-link {
    li {
        float: left;
        font-size: 14px;

        a {
            color: #999;
        }

        i,
        span {
            font-size: 13px;
            margin-right: 5px;
        }

        &:after {
            content: "|";
            padding-left: 10px;
            padding-right: 10px;
        }

        &:last-child:after {
            display: none;
        }
    }

    &:after {
        content: "";
        clear: both;
        display: table;
    }
}

.blog_item_img {
    position: relative;

    .blog_item_date {
        position: absolute;
        bottom: -10px;
        left: 10px;
        display: block;
        color: $white_color;
        background-color: #ff6426;
        padding: 8px 15px;
        border-radius: 5px;

        @media (min-width: 768px) {
            bottom: -20px;
            left: 40px;
            padding: 13px 30px;
        }

        h3 {
            font-size: 22px;
            font-weight: 600;
            color: $white_color;
            margin-bottom: 0;
            line-height: 1.2;

            @media (min-width: 768px) {
                font-size: 30px;
            }
        }

        p {
            font-size: 18px;
            margin-bottom: 0;
            color: $white_color;

            @media (min-width: 768px) {
                font-size: 18px;
            }
        }
    }
}

