/* ============ Start Blog Single Styles  ============= */

.single-post-area {
    .blog_details {
        box-shadow: none;
        padding: 0;
        padding-top: 26px;

        p {
            margin-bottom: 20px;
            font-size: 15px;
        }

        h2 {
            // color: $title-color;
        }
    }

    .social-links {
        padding-top: 10px;

        li {
            display: inline-block;
            margin-bottom: 10px;

            a {
                color: #ccc;
                padding: 7px;
                font-size: 14px;
                transition: all .2s linear;
            }
        }
    }

    .wp-block-quote {
        background: rgba(130, 139, 178, .1);
        padding: 15px;
        line-height: 1.733;
        color: #888;
        font-style: italic;
        margin-top: 25px;
        margin-bottom: 25px;

        @media (min-width: 768px) {
            padding: 30px;
        }

        > p {
            background: $white_color;
            padding: 15px 15px 15px 20px;
            border-left: 2px solid;
            margin-bottom: 0;

            @media (min-width: 768px) {
                padding: 25px 25px 25px 30px;
            }
        }
    }

    .arrow {
        position: absolute;

        .lnr {
            font-size: 20px;
            font-weight: 600;
        }
    }

    .thumb {
        .overlay-bg {
            background: rgba(#000, .8);
        }
    }

    .navigation-top {
        padding-top: 15px;
        border-top: 1px solid #f0e9ff;

        p {
            margin-bottom: 0;
        }

        .like-info {
            font-size: 14px;

            i,
            span {
                font-size: 16px;
                margin-right: 5px;
            }
        }

        .comment-count {
            font-size: 14px;

            i,
            span {
                font-size: 16px;
                margin-right: 5px;
            }
        }

        .social-icons {
            li {
                display: inline-block;
                margin-right: 15px;

                &:last-child {
                    margin: 0;
                }

                i,
                span {
                    font-size: 14px;
                    color: #999;
                }

                &:hover {
                    i,
                    span {
                        // // color: $baseColor;
                    }
                }
            }
        }
    }

    .blog-author {
        padding: 40px 30px;
        background: #fbf9ff;
        margin-top: 50px;

        @media (max-width: 600px) {
            padding: 20px 8px;
        }

        img {
            width: 90px;
            height: 90px;
            border-radius: 50%;
            margin-right: 30px;

            @media (max-width: 600px) {
                margin-right: 15px;
                width: 45px;
                height: 45px;
            }
        }

        a {
            display: inline-block;

            // color: $title-color;
            &:hover {
                color: $btn_bg;
            }
        }

        p {
            margin-bottom: 0;
            font-size: 15px;
        }

        h4 {
            font-size: 16px;
            text-transform: capitalize;
        }
    }

    .navigation-area {
        border-bottom: 1px solid #eee;
        padding-bottom: 30px;
        margin-top: 55px;

        p {
            margin-bottom: 0;
        }

        h4 {
            font-size: 18px;
            line-height: 25px;
            // color: $title-color;
        }

        .nav-left {
            text-align: left;

            .thumb {
                margin-right: 20px;
                background: #000;

                img {
                    @include transform_time(.5s);
                }
            }

            .lnr {
                margin-left: 20px;
                opacity: 0;

                @include transform_time(.5s);
            }

            &:hover {
                .lnr {
                    opacity: 1;
                }

                .thumb {
                    img {
                        opacity: .5;
                    }
                }
            }

            @media (max-width: 767px) {
                margin-bottom: 30px;
            }
        }

        .nav-right {
            text-align: right;

            .thumb {
                margin-left: 20px;
                background: #000;

                img {
                    @include transform_time(.5s);
                }
            }

            .lnr {
                margin-right: 20px;
                opacity: 0;

                @include transform_time(.5s);
            }

            &:hover {
                .lnr {
                    opacity: 1;
                }

                .thumb {
                    img {
                        opacity: .5;
                    }
                }
            }
        }
    }

    .sidebar-widgets {
        @media (max-width: 991px) {
            padding-bottom: 0;
        }
    }
}

.comments-area {
    background: transparent;
    // border: 1px solid #eee;
    border-top: 1px solid #eee;
    padding: 45px 0;
    margin-top: 50px;

    @media (max-width: 414px) {
        padding: 50px 8px;
    }

