/************** burger menu *****************/
.navbar-toggler {
    width: 30px;
    height: 30px;
    position: relative;
    transform: rotate(0deg);
    transition: .5s ease-in-out;
    cursor: pointer;

    span {
        display: block;
        position: absolute;
        height: 3px;
        width: 100%;
        background: #8a8a8a;
        border-radius: 9px;
        opacity: 1;
        left: 0;
        transform: rotate(0deg);
        transition: .25s ease-in-out;

        &:nth-child(1) {
            top: 0;
        }

        &:nth-child(2) {
            top: 12px;
        }

        &:nth-child(3) {
            top: 24px;
        }
    }

    &.open {
        span:nth-child(1) {
            top: 12px;
            transform: rotate(135deg);
        }

        span:nth-child(2) {
            opacity: 0;
            left: -60px;
        }

        span:nth-child(3) {
            top: 13px;
            transform: rotate(-135deg);
        }
    }
}
